    false,nt"url": null,nt"notes": "This Land Protection Plan (LLP) discusses
    the need for acquiring additional acres within the boundary of the San Luis Valley
    National Wildlife Refuge Complex. The Service proposes to include the Sangre de
    Cristo Conservation Area (SCCA) in the San Luis Valley National Wildlife Refuge
    Complex. The purpose of the SCCA is to protect high-elevation wildlife habitat of
    the Sangre de Cristo Mountains and the uplands of the southeastern San Luis Valley,
    with emphasis on migratory birds and imperiled species. The SCCA acquisitions will
    focus on the protection of sagebrush habitat as well as riparian corridors and associated
    uplands.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
